import styled from 'styled-components'

export default styled.div`
    .bottom {
        border-top: 1px solid #f2f2f2;
        font-size: 12px;
        position: fixed;
        bottom: 0;
        width: 100%;
        padding: 10px;
        background-color: rgb(250, 249, 245);
    }
    .bottom p {
        color: rgb(203, 196, 196);
        text-align: center;
    }
`
